import React from 'react';
import styles from './index.module.scss';

interface NavProps extends React.HTMLAttributes<HTMLDivElement> {}

const Nav: React.FC<NavProps> = (props: NavProps) => {
  return <nav className={styles.nav}></nav>;
};

Nav.defaultProps = {};

export default Nav;
